import "./App.css";
import Form from "./Form";
import MapBasics from "./Map";
import Grid from "@material-ui/core/Grid";

function App() {
  return (
    <>
      <Grid container spacing={1}>
        <Grid item>
          <Form></Form>
        </Grid>
        <Grid
          item
          style={{
            display: "inline-flex",
          }}
        >
          <MapBasics></MapBasics>
        </Grid>
      </Grid>
    </>
  );
}

export default App;
